import React from 'react';
import BoyWithSunglasses from './Image/3d-render-boy-with-orange-tshirt-sunglasses.jpg';
import Roadmap from './Roadmap';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <div className="about-me rounded-xl mt-10 overflow-hidden shadow-xl shadow-slate-300 dark:shadow-slate-900">
        <h2 className="dark:text-light-heading font-semibold text-lg pt-1">About Me</h2>
        <p className="text-content pt-4 font-light">Your about me content goes here...</p>
      </div>
      <Roadmap />
      <div className="grid-container">
        <div className="grid-item animated-image rounded-xl mt-10 overflow-hidden shadow-xl shadow-slate-300 dark:shadow-slate-900">
          <img src={BoyWithSunglasses} alt="3D Render Boy with Orange T-Shirt and Sunglasses" loading="lazy" />
        </div>
        <div className="grid-item coding-work rounded-xl mt-10 overflow-hidden shadow-xl shadow-slate-300 dark:shadow-slate-900">
          <div className="dark:bg-dark-card p-4">
            <h2 className="dark:text-light-heading font-semibold text-lg pt-1">Coding Work</h2>
            <p className="text-content pt-4 font-light">Details about your coding projects go here...</p>
            <a href="/coding-work" className="underline pl-2 font-light dark:text-white">More</a>
          </div>
        </div>
        <div className="grid-item photographs rounded-xl mt-10 overflow-hidden shadow-xl shadow-slate-300 dark:shadow-slate-900">
          <div className="dark:bg-dark-card p-4">
            <h2 className="dark:text-light-heading font-semibold text-lg pt-1">Photographs</h2>
            <p className="text-content pt-4 font-light">Details about your photographs go here...</p>
            <a href="/photographs" className="underline pl-2 font-light dark:text-white">More</a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
